import React from "react";

const WaitList = () => {
  return (
    <>
      <div className=" bg-black text-white flex flex-col items-center justify-center">
        <button className="relative bg-black text-white text-lg font-semibold py-4 px-16 rounded-full border border-gray-700 shadow-md hover:shadow-lg transition">
          Join Waitlist
          <span className="absolute inset-x-0 bg-gradient-to-r from-purple-500 to-pink-500 rounded-full opacity-50 blur-md"></span>
        </button>
      </div>
      <div className="absolute bg-white text-black [font:sans-serif] font-semibold py-2 px-9 rounded-full shadow-md hover:bg-gray-200 transition">
        <button className="font-bold text-[15px]">Join Waitlist</button>
      </div>
    </>
  );
};

export default WaitList;
